package pl.coderslab.BWF.model;import lombok.Builder;import lombok.Getter;@Getter@Builderpublic class SoccerMatchDto {    private Long id;    private String stage;    private int homeTeamId;    private String homeTeam;    private int homeTeamScore;    private int awayTeamId;    private String awayTeam;    private int awayTeamScore;    private String utcDate;    private String score;    private String group;    @Override    public String toString() {        return "MatchDto{" +                "id=" + id +                ", utcDate='" + utcDate + '\'' +                ", stage='" + stage + '\'' +                ", group='" + group + '\'' +                ", homeTeamId=" + homeTeamId +                ", homeTeam='" + homeTeam + '\'' +                ", homeTeamScore=" + homeTeamScore +                ", awayTeamId=" + awayTeamId +                ", awayTeam='" + awayTeam + '\'' +                ", awayTeamScore=" + awayTeamScore +                ", score='" + score + '\'' +                '}';    }}